import React from 'react'
import './App.css';
import UserList from './components/Users';

class App extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      'authors' : []
    }
  }
  render() {
    return (
      <div>
        <UserList users={this.state.authors}/>
      </div>
    )
  }

}
export default App;
